import React from 'react';
import NavItem from '../components/navigation/NavItem.jsx';
import cimg from '../img/calendar.svg';
import Modal from '../components/modal/Modal.jsx';

const About = ({ btnNum, setBtnNum, active, setActive }) => {


    return (

        <main>
            <div className="container">
                <div className="btn_window_container">
                </div>
                <NavItem btn_name={"ИСТОРИЯ"} btnNum={btnNum} setBtnNum={setBtnNum} active={active} setActive={setActive} nav_num={2} nav_img={calendar_img} />

            </div>
            <Modal num={btnNum} active={active} setActive={setActive} />
        </main>
    )
}

export default About;
